$(document).ready(function(){$(".slider").slick({slidesToShow:3,slidesToScroll:1,autoplay:!1,autoplaySpeed:2e3,dots:!1,responsive:[{breakpoint:1025,settings:{slidesToShow:1,slidesToScroll:1,autoplay:!1,autoplaySpeed:2e3,dots:!0}}]}),$("a.scrollLink").click(function(e){e.preventDefault(),$("html, body").animate({scrollTop:$($(this).attr("href")).offset().top},500)}),AOS.init()}),showModal=(e=>{let o=e.getElementByTag("img");alert(o)});